import React from 'react';
import { AppBar, Toolbar, Typography, Button, Card, CardContent, CardMedia, Grid } from '@mui/material';

const App = () => {
  return (
    <div>
      {/* Navigation Bar (AppBar) */}
      <AppBar position="static">
        <Toolbar>
          <Typography variant="h6">Patient Management System</Typography>
          <Button color="inherit" style={{ marginLeft: 'auto' }}>Home</Button>
          <Button color="inherit">About</Button>
          <Button color="inherit">Contact</Button>
        </Toolbar>
      </AppBar>

      {/* Card with Content */}
      <Grid container justifyContent="center" style={{ marginTop: '20px' }}>
        <Grid item xs={12} sm={6} md={4}>
          <Card sx={{ maxWidth: 345 }}>
            <CardMedia
              component="img"
              height="140"
              image="https://via.placeholder.com/150" // Replace with your image URL
              alt="sample image"
            />
            <CardContent>
              <Typography variant="h5" component="div">
                Card Title
              </Typography>
              <Typography variant="body2" color="text.secondary">
                This is a short description of the card. You can add more details here.
              </Typography>
            </CardContent>
          </Card>
        </Grid>
      </Grid>
    </div>
  );
}

export default App;
